  return (
    <Layout>

      <h1 id="title">Miras</h1>
      <p>
        Miras Türkiye'nin farklı yerlerindeki tarihi eser ve yapıtlar hakkında bilgi sahibi olmanızı sağlayan bir uygulamadır. 
      </p>
      <div>
        <Link href="random"><button>Rastgele bir eser</button></Link>
      </div>

    </Layout>
  )
}
